import React from 'react';
import './Game.css';



class Square extends React.Component<any> {

  render() {
    return (
      <button className={this.props.className}>{this.props.value}</button>
    )
  }
}

class Board extends React.Component {

  constructor(props:any) {
    super(props);
    this.state = {
      isWhite: true,
    }
  }

  renderSquare() {
    if (this.state.isWhite) return <Square className="white-square"/>;
  }

  render() {
    return (
      <div>
        <Square className="black-square" value="Square" />
      </div>
    )
  }
}



class Game extends React.Component {

  render() {
    return (
      <div className="App">
        <Board></Board>
      </div>
    );
  }
}

export default Game;
